import React, {Component} from 'react';
import {Row, Card, Button}  from 'react-bootstrap';

const List = (props) => {
  const { repos } = props;
  if (!repos || repos.length === 0) return <p>No repos, sorry</p>;
  return (

<Row>

  {repos.map((repo) => {
    return (
      <Card key={repo.id}>
        <Card.Img variant="top" src={repo.img} />
        <Card.Body>
          <Card.Title>{repo.title}</Card.Title>
          <Card.Text>
            {repo.description}
          </Card.Text>
        </Card.Body>
      </Card>
    )
  })}
</Row>




